webpackJsonp([277],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-python-function-divmod.json":function(e,n){e.exports={data:{markdownRemark:{html:'<h1>Python <code>divmod(a,b)</code></h1>\n<p><code>divmod()</code> is a built-in function in Python 3, which returns the quotient and remainder when dividing the number <code>a</code> by the number <code>b</code>. It takes two numbers as arguments <code>a</code> &#x26; <code>b</code>. The argument can\'t be a complex number.</p>\n<h2>Argument</h2>\n<p>It takes two arguments <code>a</code> &#x26; <code>b</code> - an integer, or a decimal number.It can\'t be a complex number.</p>\n<h2>Return Value</h2>\n<p>The return value will be the pair of positive numbers consisting of quotient and remainder obtained by dividing <code>a</code> by <code>b</code>. In case of mixed operand types, rules for binary arithmetic operators will be applied.<br>\nFor <strong>Integer number arguments</strong>, return value will be same as <code>(a // b, a % b)</code>.<br>\nFor <strong>Decimal number arguments</strong>, return value will be same as <code>(q, a % b)</code>, where <code>q</code> is usually <strong>math.floor(a / b)</strong> but may be 1 less than that.</p>\n<h2>Code Sample</h2>\n<pre><code>print(divmod(5,2)) # prints (2,1)\nprint(divmod(13.5,2.5)) # prints (5.0, 1.0)\nq,r = divmod(13.5,2.5)  # Assigns q=quotient &#x26; r= remainder\nprint(q) # prints 5.0 because math.floor(13.5/2.5) = 5.0\nprint(r) # prints 1.0 because (13.5 % 2.5) = 1.0\n</code></pre>\n<p><img src="https://forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=3" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/FGLK/0">REPL It!</a></p>\n<p><a href="https://docs.python.org/3/library/functions.html#divmod">Official Docs</a></p>',frontmatter:{title:"Python Function Divmod",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/python-function-divmod/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/python-function-divmod/"}}}});
